import React, { Component } from 'react';
import LogoImage from '../../images/Logo.png';

class Header extends Component {
    constructor() {
        super();
    }
    avatarGenerator() {
        alert(this.props.userName);
        return ("MM");
    }
    render() {
        return (
            <React.Fragment>
                <div class="page-header sticky-top">
                    <img class="logo-header" alt="Logo" src={LogoImage} />
                    <span class="float-right" data-letters= {this.avatarGenerator()} >{this.props.userName}</span>
                </div>
            </React.Fragment>
        );
    }
}
export default Header;
